import React, { useState } from 'react';
import { Grid } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';
import MUIDataTable from 'mui-datatables';
import { Box, styled, Icon } from '@mui/material';
import { Breadcrumb } from 'app/components';
import Button from '@mui/material/Button';
import { OxFamLogo } from 'app/components';
// import PartnersAddForms from './PartnersAddForms';
import EditUsersIcon from 'app/components/svg-icons/EditUsersIcon';
import AddUsersIcon from 'app/components/svg-icons/AddUsersIcon';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const datatableData = [
  [
    'Warly De La Cruz',
    'warly.dela.cruz@gmail.com',
    '09173052124',
    'CIC',
    'Admin',
    '8/08/2022 08:08',
    '8/08/2022 08:08',
    'Active',
    <EditUsersIcon />,
  ],
  [
    'Mark Athena Agana',
    'markAthenaAgana@gmail.com',
    '09171234567',
    'LANEX',
    'Project Woner',
    '8/09/2022 08:08',
    '8/10/2022 10:08',
    'Active',
    <EditUsersIcon />,
  ],
  [
    'Mark Zuckerberg',
    'mark-zuckerberg@facebook.com',
    '09999999999',
    'Facebook',
    'Partner',
    '8/08/2022 08:08',
    '8/08/2022 08:08',
    'For approval',
    <EditUsersIcon />,
  ],
  [
    'Rodrigo Duterte',
    'digongdu30@malacanaNG.com',
    '09271434455',
    'OOTP',
    'Admin',
    '8/08/2022 08:08',
    '8/08/2022 08:08',
    'Active',
    <EditUsersIcon />,
  ],
  [
    'Bong Bong Marcos',
    'bong2x@malacanaNG.com',
    '09091434456',
    'OOTP',
    'Partner',
    '8/08/2022 08:08',
    '8/08/2022 08:08',
    'For approval',
    <EditUsersIcon />,
  ],
];

const useStyles = makeStyles((theme) => ({
  tableOverflow: {
    overflow: 'auto',
  },
  addButton: {
    position: 'absolute',
    color: 'white',
    size: 'medium',
    right: '25px',
  },
}));

const Container = styled('div')(({ theme }) => ({
  margin: '30px',
  [theme.breakpoints.down('sm')]: { margin: '16px' },
  '& .breadcrumb': {
    marginBottom: '30px',
    [theme.breakpoints.down('sm')]: { marginBottom: '16px' },
  },
  '& .addButton': {
    marginBottom: '30px',
    [theme.breakpoints.down('sm')]: { marginBottom: '16px' },
  },
}));

const options = {
  onRowsDelete: (rowsDeleted, dataRows) => {
    console.log(dataRows[0]);
    console.log(rowsDeleted.data);
  },
};

const AppUsersTable = () => {
  const classes = useStyles();
  const [showModal, setShowModal] = useState(false);
  // const showAddParticipantsModal = () => {

  console.log('Show Modal ' + showModal);
  // };
  const openModal = () => {
    setShowModal((prev) => !prev);
  };

  // onClick={handleClickOpen('paper')}
  return (
    <Container>
      <Box className="breadcrumb" display="flex">
        <Breadcrumb
          routeSegments={[{ name: 'App Users', path: '/records' }, { name: 'Records' }]}
        />
        <Button
          variant="contained"
          color="success"
          className={classes.addButton}
          onClick={openModal}
        >
          <Icon>add</Icon>
          <span>Users</span>
        </Button>
      </Box>

      <Grid container spacing={4}>
        <Grid item xs={12}>
          <MUIDataTable
            title="App Users List"
            data={datatableData}
            columns={[
              'Name',
              'Email',
              'Contact',
              'Company',
              'Role',
              'Created_at',
              'Updated_at',
              'Access Status',
              'Action',
            ]}
            options={options}
          />
        </Grid>
      </Grid>
      {/* <PartnersAddForms showModal={showModal} setShowModal={setShowModal} /> */}
    </Container>
  );
};
export default AppUsersTable;
